// SPDX-License-Identifier: GPL-3.0-or-later
pragma solidity ^0.8.24;

import {IERC165} from "@openzeppelin/contracts/utils/introspection/IERC165.sol";

/**
 * @title Interface for respect tokens from Orec perspective.
 * Contract which act as respectContract in Orec should support this.
 */
interface IRespect is IERC165 {
    /**
     * @dev Returns the number of *fungible* Respect ``account`` has.
     */
    function respectOf(address account) external view returns (uint256);
}

contracts/MintableRespectToken.sol.content:
// SPDX-License-Identifier: GPL-3.0-only
pragma solidity ^0.8.24;

import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/token/ERC20/ERC20.sol";
import {ERC165} from "@openzeppelin/contracts/utils/introspection/ERC165.sol";
import "./IRespect.sol";

contract MintableRespectToken is IRespect, Ownable, ERC20, ERC165 {
    constructor(
      address owner,
      string memory name_,
      string memory symbol_
    ) ERC20(name_, symbol_) Ownable(owner) { }

    function mint(address account, uint256 amount) public onlyOwner {
        _mint(account, amount);
    }

    function burn(address account, uint256 amount) public onlyOwner {
        _burn(account, amount);
    }

    function respectOf(address account) public view returns (uint256) {
      return balanceOf(account);
    }

    function respectInterfaceId() external pure returns (bytes4) {
      return type(IRespect).interfaceId;
    }

    function supportsInterface(bytes4 interfaceId) public view virtual override(ERC165, IERC165) returns (bool) {
        return interfaceId == type(IERC20).interfaceId ||
               interfaceId == type(IRespect).interfaceId ||
               super.supportsInterface(interfaceId);
    }
}

